/* eslint-disable no-unused-vars */
import * as BookAPI from '../BooksAPI';

const Output = (argone, argtwo, Method) =>{
    
    

    if(Method ==='update'){
        const UpdataResult = async () =>{
            const update = await BookAPI.update(argone, argtwo);
            return update;
        }
        UpdataResult()
            .then(update => {console.log(update, 'update')})
                .catch(() => {
                    console.log('%c Error occured when fetching books when update',
                    'background-color:black; font-size:20px;color:red;');
        });
    }
    
    if(argone === 'getall'){
        const SearchResult = async () =>{
            const data = await BookAPI.getAll();
            return data;
        }
        SearchResult()
            .then(res => {console.log(res);})
                .catch(() => {
                    console.log('%c Error occured when fetching books when getAll',
                    'background-color:black; font-size:20px;color:red;');
        });
    }
}
export default Output;
